/*
 * This is the primary high-level API for the project. In this folder there should be:
 * A class called InsightFacade, this should be in a file called InsightFacade.ts.
 * You should not change this interface at all or the test suite will not work.
 */

export enum InsightDatasetKind {
	Sections = "sections",
	Rooms = "rooms",
}

export interface InsightDataset {
	id: string;
	kind: InsightDatasetKind;
	numRows: number;
}

export interface InsightResult {
	[key: string]: string | number;
}

export class InsightError extends Error {
	constructor(message?: string) {
		super(message);
		Error.captureStackTrace(this, InsightError);
	}
}

export class NotFoundError extends Error {
	constructor(message?: string) {
		super(message);
		Error.captureStackTrace(this, NotFoundError);
	}
}

export class ResultTooLargeError extends Error {
	constructor(message?: string) {
		super(message);
		Error.captureStackTrace(this, ResultTooLargeError);
	}
}

export interface IInsightFacade {
	/**
	 * Add a dataset to insightUBC.
	 *
	 * @param id  The id of the dataset being added. Follows the format /^[^_]+$/
	 * @param content  The base64 content of the dataset. This content should be in the form of a serialized zip file.
	 * @param kind  The kind of the dataset
	 *
	 * @return Promise <string[]>
	 *
	 * The promise should fulfill on a successful add, reject for any failures.
	 * The promise should fulfill with a string array,
	 * containing the ids of all currently added datasets upon a successful add.
	 * The promise should reject with an InsightError describing the error.
	 *
	 * An id is invalid if it contains an underscore, or is only whitespace characters.
	 * If id is the same as the id of an already added dataset, the dataset should be rejected and not saved.
	 *
	 * After receiving the dataset, it should be processed into a data structure of
	 * your design. The processed data structure should be persisted to disk; your
	 * system should be able to load this persisted value into memory for answering
	 * queries.
	 *
	 * Ultimately, a dataset must be added or loaded from disk before queries can
	 * be successfully answered.
	 */
	addDataset(id: string, content: string, kind: InsightDatasetKind): Promise<string[]>;

	/**
	 * Remove a dataset from insightUBC.
	 *
	 * @param id  The id of the dataset to remove. Follows the format /^[^_]+$/
	 *
	 * @return Promise <string>
	 *
	 * The promise should fulfill upon a successful removal, reject on any error.
	 * Attempting to remove a dataset that hasn't been added yet counts as an error.
	 *
	 * An id is invalid if it contains an underscore, or is only whitespace characters.
	 *
	 * The promise should fulfill the id of the dataset that was removed.
	 * The promise should reject with a NotFoundError (if a valid id was not yet added)
	 * or an InsightError (invalid id or any other source of failure) describing the error.
	 *
	 * This will delete both disk and memory caches for the dataset for the id meaning
	 * that subsequent queries for that id should fail unless a new addDataset happens first.
	 */
	removeDataset(id: string): Promise<string>;

	/**
	 * Perform a query on insightUBC.
	 *
	 * @param query  The query to be performed.
	 *
	 * If a query is incorrectly formatted, references a dataset not added (in memory or on disk),
	 * or references multiple datasets, it should be rejected.
	 *
	 * @return Promise <InsightResult[]>
	 *
	 * The promise should fulfill with an array of results.
	 * The promise should reject with a ResultTooLargeError (if the query returns too many results)
	 * or an InsightError (for any other source of failure) describing the error.
	 */
	performQuery(query: unknown): Promise<InsightResult[]>;

	/**
	 * List all currently added datasets, their types, and number of rows.
	 *
	 * @return Promise <InsightDataset[]>
	 * The promise should fulfill an array of currently added InsightDatasets, and will only fulfill.
	 */
	listDatasets(): Promise<InsightDataset[]>;
}

import {
	IInsightFacade,
	InsightDataset,
	InsightDatasetKind,
	InsightError,
	InsightResult,
	NotFoundError,
	ResultTooLargeError,
} from "./IInsightFacade";
import * as fs from "fs-extra";
import JSZip from "jszip";
import QueryParser from "./QueryEngine/Parser";
import Query from "./QueryEngine/Query";
import * as parse5 from "parse5";
import {findTableAndProcess} from "./InsightFacadeAddBuilding";
/**
 * This is the main programmatic entry point for the project.
 * Method documentation is in IInsightFacade
 */
interface Sect {
	avg: number;
	pass: number;
	fail: number;
	audit: number;
	year: number;
	dept: string;
	id: string;
	instructor: string;
	title: string;
	uuid: string;
}
export default class InsightFacade implements IInsightFacade {

	private datasets: Map<string, InsightDataset>;
	private data: Map<string,any[]>;

	constructor() {
		this.datasets = new Map<string, InsightDataset>();
		this.data = new Map<string,any[]>();
		let folderPath = "./data";
		if (fs.pathExistsSync("./data")) {
			fs.readdirSync(folderPath).forEach((id) => {
				let arr: any[] = [];
				if (fs.pathExistsSync(folderPath + "/" + id + "/rooms")) {
					fs.readdirSync(folderPath + "/" + id + "/rooms").forEach((file) => {
						arr.push(fs.readJSONSync(folderPath + "/" + id + "/rooms/" + file));
					});
					this.datasets.set(id, {id: id, kind: InsightDatasetKind.Rooms, numRows: arr.length});
				} else {
					let count = 0;
					fs.readdirSync(folderPath + "/" + id).forEach((file) => {
						const sections = fs.readJSONSync(folderPath + "/" + id + "/" + file);
						count += this.isValidCourse(sections, id, id, arr, 1);
					});
					this.datasets.set(id, {id: id, kind: InsightDatasetKind.Sections, numRows: count});
				}
				this.data.set(id, arr);
			});
		}
	}

	private validateID(id: string): boolean {
		if (id.includes("_")) {
			return true;
		}
		return id.trim() === "";
	}

	// Used ChatGPT to generate this function
	public containsKey(obj: object, key: string): boolean {
		return Object.prototype.hasOwnProperty.call(obj, key);
	}

	public isValidCourse(course: any, id: string, relativePath: string, arr: any[] | null, ver: number): number {
		let count = 0;
		for (const section of course) {
			if (section["Section"] === "overall") {
				section["Year"] = 1900;
			}
			if (
				this.containsKey(section, "Avg") &&
				this.containsKey(section, "Pass") &&
				this.containsKey(section, "Fail") &&
				this.containsKey(section, "Audit") &&
				this.containsKey(section, "Year") &&
				this.containsKey(section, "Subject") &&
				this.containsKey(section, "Course") &&
				this.containsKey(section, "Professor") &&
				this.containsKey(section, "Title") &&
				this.containsKey(section, "id")
			) {
				const jsonObject: Sect = {
					avg: section["Avg"],
					pass: section["Pass"],
					fail: section["Fail"],
					audit: section["Audit"],
					year: parseInt(section["Year"],10),
					dept: section["Subject"],
					id: section["Course"],
					instructor: section["Professor"],
					title: section["Title"],
					uuid: section["id"],
				};
				if (arr) {
					arr.push(jsonObject);
				}
				count++;
			}
		}
		if (count && !ver) {
			fs.outputJSONSync("./data/" + id + "/" + relativePath + ".json", course);
		}
		return count;
	}

	public async addDataset(id: string, content: string, kind: InsightDatasetKind): Promise<string[]> {
		try {
			if (kind === InsightDatasetKind.Sections) {
				return this.addSectionsDataset(id, content);
			} else if (kind === InsightDatasetKind.Rooms) {
				return this.addRoomsDataset(id, content);
			} else {
				return Promise.reject(new InsightError("Invalid kind."));
			}
		} catch (err: any) {
			return Promise.reject(new InsightError());
		}
	}

	public async addRoomsDataset(id: string, content: string): Promise<string[]> {
		try {
			if (this.validateID(id) || this.data.has(id)) {
				return Promise.reject(new InsightError());
			}
			let zip = new JSZip();
			await zip.loadAsync(content, {base64: true, createFolders: true});
			const index = zip.file("index.htm");
			let promises: Array<Promise<any>> = [];
			let arr: any[] = [];
			if (index) {
				const indexContent = await index.async("text");
				let document = parse5.parse(indexContent);
				findTableAndProcess(document, arr, zip, id, promises);
				await Promise.allSettled(promises);
				if (fs.readdirSync("./data/" + id + "/rooms").length === 0) {
					return Promise.reject(new InsightError("No Valid Rooms"));
				}
				this.data.set(id, arr);
				this.datasets.set(id, {id: id, kind: InsightDatasetKind.Rooms, numRows:
						(fs.readdirSync("./data/" + id + "/rooms").length)});
			} else {
				return Promise.reject(new InsightError("Non index folder"));
			}
			return Promise.resolve(fs.readdirSync("./data"));
		} catch (error: any) {
			return Promise.reject(new InsightError());
		}
	}

	public async addSectionsDataset(id: string, content: string): Promise<string[]> {
		try {
			if (this.validateID(id) || this.data.has(id)) {
				return Promise.reject(new InsightError());
			}
			let zip = new JSZip();
			await zip.loadAsync(content, {base64: true, createFolders: true});
			const coursesFolder = zip.folder("courses");
			let promises: Array<Promise<any>> = [];
			let arr: any[] = [];
			if (coursesFolder) {
				let totalCount = 0;
				coursesFolder.forEach(async (relativePath, file) => {
					promises.push(
						file.async("string").then(async (data) => {
							let json = JSON.parse(data);
							const sections = json.result;
							totalCount += this.isValidCourse(sections, id, relativePath, arr, 0);
						})
					);
				});
				await Promise.all(promises);
				if (totalCount === 0) {
					return Promise.reject(new InsightError("No data."));
				}
				this.data.set(id, arr);
				this.datasets.set(id, {id: id, kind: InsightDatasetKind.Sections, numRows: totalCount});
			} else {
				return Promise.reject(new InsightError("Non Existent Courses folder"));
			}

			return Promise.resolve(fs.readdirSync("./data"));
		} catch (error: any) {
			return Promise.reject(new InsightError());
		}
	}

	public async removeDataset(id: string): Promise<string> {
		try {
			if (this.validateID(id)) {
				return Promise.reject(new InsightError("Invalid ID"));
			}
			if (!this.data.delete(id)) {
				return Promise.reject(new NotFoundError("Not found error"));
			}
			this.datasets.delete(id);
			fs.removeSync("./data/" + id);
			return Promise.resolve(id);
		} catch (err: any) {
			return Promise.reject(new InsightError());
		}
	}

	public async performQuery(query: unknown): Promise<InsightResult[]> {
		try {
			let parse = new QueryParser(query, fs.readdirSync("./data"));
			let queryEngine = new Query(parse, this.data);

			let queryResults: InsightResult[] = queryEngine.results();
			// for (const r of queryResults) {
			// 	console.log(r);
			// }
			return Promise.resolve(queryResults);
		} catch (err: any) {
			if (err instanceof InsightError || err instanceof ResultTooLargeError) {
				return Promise.reject(err);
			} else {
				return Promise.reject(new InsightError());
			}
		}
	}

	public listDatasets(): Promise<InsightDataset[]> {
		try {
			return Promise.resolve(Array.from(this.datasets.values()));
		} catch (err: any) {
			return Promise.reject(new InsightError());
		}
	}
}

import {InsightError} from "../IInsightFacade";
import QueryValidator from "./Validator";

export default class QueryParser {
	public where: Map<string, any[]>;
	public columns: string[];
	public order: string;
	public dir: string;
	public keys: string[];
	public group: string[];
	public apply: any;
	public endCols: string[];
	public validator: QueryValidator;

	private parsed: any;
	private whereFields = ["AND", "OR", "LT", "GT", "EQ", "IS", "NOT"];
	private trans: boolean;

	constructor(query: any, ids: string[]) {
		this.where 	   = new Map<string, any>();
		this.columns   = [];
		this.endCols   = [];
		this.order	   = "";
		this.dir	   = "";
		this.keys 	   = [];
		this.group	   = [];
		this.apply 	   = [];
		this.validator = new QueryValidator(ids);
		this.trans 	   = false;

		this.parsed = JSON.parse(JSON.stringify(query));
		if (!this.parsed.WHERE || !this.parsed.OPTIONS) {
			throw new InsightError("Missing WHERE or OPTIONS");
		}
		if (this.parsed.TRANSFORMATIONS) {
			this.getTrans(this.parsed.TRANSFORMATIONS);
		}

		let whereParts = this.getWhere(this.parsed.WHERE);
		this.where.set(whereParts[0], whereParts[1]);

		this.getOptions();

		if (this.parsed.TRANSFORMATIONS) {
			this.validator.validateAllColumnsPresent();
		}
	}

	public hasTransformations() {
		return this.trans;
	}

	private getTrans(transData: any) {
		try {
			let hasGroup: boolean = false;
			let hasApply: boolean = false;
			if (this.containsKey(transData, "GROUP")) {
				this.group = transData["GROUP"].toString().split(",");
				this.validator.validateGroup(this.group);
				hasGroup = true;
			}
			if (this.containsKey(transData, "APPLY")) {
				this.apply = JSON.parse(JSON.stringify(transData["APPLY"]));
				this.validator.validateApply(this.apply);
				for (const applyRule in this.apply) {
					for (const applyKey in this.apply[applyRule]) {
						for (const applyToken in this.apply[applyRule][applyKey]) {
							let key: string = this.apply[applyRule][applyKey][applyToken];
							if (this.columns.indexOf(key) === -1) {
								this.columns.push(key);
							}
						}
					}
				}
				hasApply = true;
			}

			if((hasGroup && !hasApply) || (!hasGroup && hasApply)) {
				throw new Error("Missing attribute in transformation.");
			} else if (hasGroup && hasApply) {
				this.trans = true;
			}

		} catch (err: any) {
			throw new InsightError(err);
		}
	}

	private getWhere(whereData: any): any[] {
		try {
			let ret: any[] = [];
			this.whereFields.forEach((filter) => {
				if (this.containsKey(whereData, filter)) {
					switch(filter) {
						case "GT":
						case "LT":
						case "IS":
						case "EQ": {
							// Split the "sections_avg" into ["sections", "avg"]
							let valString: string[] = [];
							for (const part in whereData[filter]) {
								valString = part.split("_");
								valString.push(whereData[filter][part]);
								if (this.columns.indexOf(part) === -1) {
									this.columns.push(part);
								}
							}
							if(!this.validator.validateWhereKey(filter, valString[1], valString[2])) {
								throw new Error("Invalid key.");
							}

							this.validator.checkDifferentID(valString[0]);
							ret[0] = filter;
							ret[1] = valString;
							break;

						}
						case "AND":
						case "OR": {
							let filterList: any[] = [];
							filterList[0] = this.getWhere(JSON.parse(JSON.stringify(whereData[filter][0])));
							filterList[1] = this.getWhere(JSON.parse(JSON.stringify(whereData[filter][1])));
							ret[0] = filter;
							ret[1] = filterList;
							break;
						}
						case "NOT": {
							ret[0] = filter;
							ret[1] = this.getWhere(JSON.parse(JSON.stringify(whereData[filter])));
							break;
						}
					}
				}
			});
			return ret;
		} catch (err: any) {
			throw new InsightError(err);
		}
	}

	private getOptions() {
		try {
			const optionsData = this.parsed.OPTIONS;
			if (this.containsKey(optionsData, "COLUMNS")) {
				this.endCols = optionsData["COLUMNS"].toString().split(",");
				for (const x in this.endCols) {
					this.columns.push(this.endCols[x]);
				}
				this.validator.validateColumn(this.columns, this.endCols);
			} else {
				throw new Error("Options does not have columns.");
			}
			if (this.containsKey(optionsData, "ORDER")) {
				let sort = optionsData["ORDER"];
				let hasDir: boolean = false;
				let hasKeys: boolean = false;

				if (this.containsKey(sort, "dir")) {
					this.dir = sort["dir"];
					if (!this.validator.validateSortDir(this.dir)) {
						throw new Error("Invalid dir in Sort.");
					}
					hasDir = true;
				}
				if (this.containsKey(sort, "keys")) {
					this.keys = sort["keys"];
					this.validator.validateSortKeys(this.keys);
					for (const col in this.keys) {
						if (this.endCols.indexOf(this.keys[col]) === -1) {
							throw new Error("Keys in ORDER must be in COLUMN.");
						}
					}
					hasKeys = true;
				}

				if (!hasDir && !hasKeys) {
					if (sort === null) {
						throw new Error("Empty Sort.");
					} else {
						this.order = sort;
						this.validator.validateOrder(this.order);
					}
				} else if ((hasDir && !hasKeys) || (!hasDir && hasKeys)) {
					throw new Error("Missing attribute in sort.");
				}
			}
		} catch (err: any) {
			throw new InsightError(err);
		}
	}

	// Used ChatGPT to generate this function
	public containsKey(obj: object, key: string): boolean {
		return Object.prototype.hasOwnProperty.call(obj, key);
	}
}

import {InsightError} from "../IInsightFacade";

export default class QueryValidator {
	private datasetIDs: string[];
	public dataSetKey: string;
	private applyKeys: string[];
	private columns: string[];
	private transCols: string[];
	private applyTokens = ["MAX", "MIN", "AVG", "COUNT", "SUM"];
	private mkeyFields = ["avg", "pass", "fail", "audit", "year", "lat", "lon", "seats"];
	private skeyFields = ["dept", "id", "instructor", "title", "uuid", "fullname", "shortname", "number", "name",
		"address", "type", "furniture", "href"];

	constructor(ids: string[]) {
		this.datasetIDs = ids;
		this.dataSetKey = "";
		this.applyKeys  = [];
		this.columns 	= [];
		this.transCols  = [];
	}

	public validateWhereKey(key: string, field: any, value: any): boolean {
		switch(key) {
			case "GT":
			case "LT":
			case "EQ": {
				if (this.skeyFields.indexOf(field) !== -1) {
					throw new Error("Wrong field type.");
				}
				return ((typeof value) === "number");
			}
			case "IS": {
				if (this.mkeyFields.indexOf(field) !== -1) {
					throw new Error("Wrong field type.");
				}
				return ((typeof value) === "string");
			}
		}
		return false;
	}

	public validateGroup(group: any[]) {
		for (const item in group) {
			this.validateKey(group[item]);
			if (this.transCols.indexOf(group[item]) === -1) {
				this.transCols.push(group[item]);
			}
		}
	}

	public validateApply(apply: string[][]) {
		for (const index in apply) {
			this.validateApplyRule(apply[index]);
		}
	}

	public validateColumn(columns: string[], columnData: string[]) {
		this.validateAnyKeyList(columns);
		this.columns = columnData;
	}

	public validateAllColumnsPresent() {
		for (const col in this.columns) {
			if (this.transCols.indexOf(this.columns[col]) === -1) {
				throw new Error("Keys in COLUMNS must be in GROUP or APPLY when TRANSFORMATIONS is present");
			}
		}
	}

	public validateOrder(order: string) {
		if (typeof order !== "string") {
			throw new Error("Too many order columns.");
		}

		let field = order.split("_");
		const id: string = field[0];
		const key: string = field[1];

		if ((typeof field[0]) !== "string" || (typeof field[1]) !== "string") {
			throw new Error("Invalid order type.");
		}

		this.inDatasetList(id);
		this.checkDifferentID(id);

		if (!this.inKeyList(key)) {
			throw new Error("Invalid order key.");
		}
	}

	public validateSortDir(dir: string): boolean {
		if (typeof dir !== "string") {
			throw new Error("Incorrect dir type in Sort.");
		}
		if (dir === "DOWN" || dir === "UP") {
			return true;
		}
		return false;
	}

	public validateSortKeys(sortKeys: string[]) {
		this.validateAnyKeyList(sortKeys);
	}

	private validateApplyRule(applyRule: any[]) {
		let applyKey: string = "";
		let applyValue: string[] = [];
		for (const item in applyRule) {
			applyKey = item;
			applyValue = applyRule[item];
		}
		if (applyKey.indexOf("_") !== -1) {
			throw new Error("Invalid character in key.");
		}
		if (applyKey.length < 1) {
			throw new Error("Invalid key length");
		}
		if (this.applyKeys.indexOf(applyKey) !== -1) {
			throw new Error("No duplicate apply keys allowed.");
		} else {
			this.applyKeys.push(applyKey);
			if (this.transCols.indexOf(applyKey) === -1) {
				this.transCols.push(applyKey);
			}
		}
		for (const item in applyValue) {
			this.validateApplyToken(item);
			this.validateApplyRuleKey(item, applyValue[item]);

		}
	}

	private validateApplyToken(token: string) {
		if (this.applyTokens.indexOf(token) === -1) {
			throw new Error("Apply token invalid.");
		}
	}

	private validateApplyRuleKey(token: string, key: any) {
		let field = key.split("_");
		const fieldKey: string = field[1];
		switch (token) {
			case "MAX":
			case "MIN":
			case "AVG":
			case "SUM":
				if (this.mkeyFields.indexOf(fieldKey) === -1) {
					throw new Error("Wrong Apply Key Type.");
				}
				break;
			case "COUNT":
				break;
			default:
				throw new Error("Invalid Apply Rule Token.");
		}
		this.validateKey(key);
	}

	private validateAnyKeyList(keys: string[]){
		for (const index in keys) {
			if (keys[index].indexOf("_") !== -1) {
				this.validateKey(keys[index]);
			} else {
				this.validateApplyKey(keys[index]);
			}
		}
	}

	private validateApplyKey(applyKey: string) {
		if (typeof applyKey !== "string") {
			throw new Error("Invalid key type");
		}
		if (applyKey.indexOf("_") !== -1) {
			throw new Error("Invalid character in key.");
		}
		if (applyKey.length < 1) {
			throw new Error("Invalid key length");
		}
		if (this.applyKeys.indexOf(applyKey) === -1) {
			throw new Error("Apply key is not given in the apply list.");
		}
	}

	private validateKey(givenKey: string) {
		let field = givenKey.split("_");
		const id: string = field[0];
		const key: string = field[1];

		if ((typeof id) !== "string" || (typeof key) !== "string") {
			throw new Error("Invalid key type.");
		}

		this.inDatasetList(id);
		this.checkDifferentID(id);

		if (key.indexOf("_") !== -1) {
			throw new Error("Invalid character in key.");
		}
		if (key.length < 1) {
			throw new Error("Invalid key length");
		}

		if (!this.inKeyList(key)) {
			throw new Error("Invalid key.");
		}

	}

	public inKeyList(queryKey: string): boolean {
